import React from 'react';
import { StyleSheet, Text, View, ScrollView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import AppNavigaion from './app/componets/Screens/FeaturedNews/AppNavigaion';
import NewsPost from './app/componets/Screens/FeaturedNews/NewsPost';
import FeaturedNewss from './app/componets/Screens/FeaturedNews/FeaturedNewss';
import Content from './app/componets/Screens/FeaturedNews/Content';

const Stack = createStackNavigator();

export default class App extends React.Component{
  render(){
    return(
      <View style={styles.container} >
        <NavigationContainer>
          <Stack.Navigator>
          <Stack.Screen name="Home" component={AppNavigaion} />
          <Stack.Screen name="FeaturedNewss" component={FeaturedNewss} />
          <Stack.Screen name="NewsPost" component={NewsPost} />
          <Stack.Screen name="Content" component={Content} />

          </Stack.Navigator>
        </NavigationContainer>
      </View>
    )
  }
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FFF'
  }
})
